import axios from "axios";
import { default as React, useEffect, useState } from "react";
import PdfTable from "../components/PDFtable";
import TopBar from "../components/TopBar";
import ScrollableComponent from "../fragments/ScrollableComponent";
import Footer from "../components/Footer";
import { useAuth } from "../contexts/AuthContext";
import Fab from "@mui/material/Fab";
import HelpOutlineIcon from "@mui/icons-material/HelpOutline";
import { useNavigate } from "react-router-dom";
export default function News() {
  const [pdfs, setPdfs] = useState([null, null, null]);
  const [loading, setLoading] = useState(true);
  const { isAuthenticated } = useAuth();
  const navigate = useNavigate();

  const handleHelpClick = () => {
    // Navegar a la página de preguntas frecuentes
    navigate("/faq");
  };
  useEffect(() => {
    const fetchData = async () => {
      try {
        let url = process.env.REACT_APP_BACK_URL;
        const response = await axios.post(url + "/api/resources/getpdflist");
        const sortedPdfs = response.data.sort((a, b) => a.id - b.id);
        setPdfs(sortedPdfs);
      } catch (error) {
        console.error("Error fetching PDF:", error);
        // Handle error if needed
      } finally {
        setLoading(false); // Set loading to false regardless of success or failure
      }
    };

    fetchData();
  }, []);

  const base64Image =
    " data:image/jpeg;base64,";

  return (
    <>
      <TopBar userAuth={isAuthenticated} />
      <ScrollableComponent>
        <div id="detail" style={{ padding: 50 }}>
          <PdfTable pdfs={pdfs} key={loading} />
        </div>
      </ScrollableComponent>
      <Footer />
      <Fab
        color="secondary"
        aria-label="Ayuda"
        variant="extended"
        style={{ position: "fixed", bottom: 16, right: 16 }}
        onClick={handleHelpClick}
      >
        <HelpOutlineIcon sx={{ mr: 1 }} />
        {"Ayuda"}
        <img
          src={base64Image}
          alt="Ayuda"
          style={{
            marginLeft: 8,
            width: "75%",
            height: "75%",
            borderRadius: "50%",
          }}
        />
      </Fab>
    </>
  );
}
